üëâüèΩYou feel intimidated.
üëâüèΩYou‚Äôre so out of shape.
üëâüèΩYou‚Äôre not sure what people will say.
üëâüèΩYou started before but never stuck with it. It‚Äôs too hard to find momentum.
.
In 2012 I was a party animal that did NOT work out that wanted to change her life. üòå I didn‚Äôt have a great relationship with alcohol- blacking out more often than not.
.
I wasn‚Äôt in love with where my life was headed. I moved across the country. I signed up for the LA marathon & fell in love with running & this lifestyle. Running became a form of mobile meditation for me.
.
Your life CANNOT change unless you put yourself out there & make the first steps.
.
HERE‚ÄôS HOW I GOT STARTED‚Äî
.
‚ö°Ô∏èI SIGNED UP!
Signed up for a race, signed up for a group. That was the first step. I knew in order for this to FINALLY stick- I had to have ACCOUNTABILITY- from both a race & a deadline- & from people that I could form community with.
.
‚ö°Ô∏èI BEGAN WHERE I WAS!
The group I joined, you had to be able to run 20 minutes at a time. WHICH I COULD NOT! Haha. I spent a month working towards that. I created smaller incremental goals to get to 20 min at a time. I was walking home in the middle of the 20 min runs more than once- but I stayed with it.
.
‚ö°Ô∏èI STAYED CONSISTENT!
Show up everyday. It doesn‚Äôt have to be blissful & magical & life changing. It NEVER is at first. It‚Äôs just you showing up & making the first steps. Your faithfulness over time produces the results you‚Äôre hoping for. I couldn‚Äôt have imagined in 2012 when I made those first steps that it would lead to the beautiful life I have now.
.
Don‚Äôt go through life passively allowing things to happen- decide to shape life how YOU WANT. Know that CHANGE is possible! Create the life you want. If we are given this beautiful gift of another day on earth- let‚Äôs make it purposeful and fulfilling. Seek a life that brings you TOTAL JOY. That‚Äôs the only one that‚Äôs worth living. If you are looking to make a change, START NOW. Start with tangibles. But don‚Äôt delay. You DESERVE to live your best life now.
.
