2016 was when I started running not a lot just some. I had gone back to school to finish my bachelor's degree and I needed more than just walking to burn off some stress and I decided why not try some runnning.
2018 was the year that almost broke me this was also the year when my I turned running up loud! Going through a separation and feeling like I had no control over anything in my life lead me to my first run streak! I figured since I  couldn't control the shit storm surrounding me I could run at least a mile everyday and I did for 190 days. This was when I first started to use running as a therapy to get stronger mentally and physically. I ended 2018 in a much better place than I started proving I was stronger than I ever knew I was. 
2020 I'm not sure what you're deal is but this year is victory lap the sequel and I'm not letting you break me down. I've trained and ran races virtually including the half and half challenge which is Sat/Sun half marathons. And I'm currently coasting out the end of training for a full marathon which is going to be live in person!!!! Crazy I know! 
Heather in the  top photo would  never of  thought in a million years that she'd want to run a marathon some day! 
Heather in the bottom left photo couldn't make it through a day without crying and also wouldn't believe you about the marathon! 
Heather today in the bottom right knows the chapters since 2016 have not always been easy but they have all been worth it. I got stronger because I had to be but I'll continue to get stronger because I want to be. I also know I didn't get here alone. I've got where I am today because Ive got the most amazing cheerleaders in my corner having my back every step of the way and for that I'm eternally grateful! üíúüíú 
Whoa that was a long one and who's cutting onions in here. 
Final thought remember if you don't like your current path you can move  in another direction we all have the power to write a better next chapter. Be brave be strong you owe it to yourself!
